        <Input />
      </Form.Item>
      <Form.Item
        label="Ghi chú"
        name="username"
        rules={[{ required: true, message: 'Please input your username!' }]}
      >
        <Input style={{height : '200px'}} />
      </Form.Item>
      

        
        </Form>
 
      </FormWrapper>
    
  );
};
export default AddServiceCategoryView;
